import { getCookie } from "./helpers/auth";
const id = getCookie().token


export const Notifications = createContext([]);
let fnc = async () => {
    return axios.post("http://localhost:2704/api/msgC/contactL?start=" + 0 + "&end=" + 10, { id })
        .then(res => {
            if (!res.data.message) {
                console.log(res.data)
                return res.data
            }
        }).catch(err => {
        });
}
export const MessageList = createContext(async () => {
    let value = await fnc()
    console.log(value)
    return value
})
